import {Drawer, Menu} from 'antd';
import { useState } from 'react';
import { MenuOutlined } from '@ant-design/icons';
const Navbar = () =>{
    const [openMenu, setOpenMenu] = useState(false);

    return(
        <div>
        <div style={{height: 0, paddingLeft: -30, paddingTop: 0,}}>
            <MenuOutlined style={{ color: "black", fontSize: 30}}
            onClick={()=>{
                setOpenMenu(true);}}
            />
        </div>
            <AppMenu/>
            <Drawer open={openMenu} 
            closable={false}
            onClose={()=>{
                setOpenMenu(false);
            }}>
                <AppMenu isInline />
            </Drawer>
        </div>
    );
};

export default Navbar;

function AppMenu({isInline=false}){
    return(
        <Menu 
            style={{ height: 100, paddingInline: 50, lineHeight: '64px', top: 50, border: 'none'}}
            mode={ isInline? "inline" :'horizontal'} 
            items={[
                {
                    label: 'Home',
                    key:'home',
                }, {
                    label: 'Contact us',
                    key:'contact',
                }, {
                    label: 'About us',
                    key:'about',
                }, {
                    label: 'Login',
                    key:'login',
                }

            ]}
            >
            </Menu>
    );
}
